(2612, 208, 'abt_text', 'We are a legacy brand that has been a highly sought after grower since 2015 and have been thriving and overcoming despite the challenges faced by small businesses in the industry. Our slogan, \"Roots of Legacy,\" speaks to our deep commitment to cultivating the finest cannabis flower, while honoring the rich history and culture of this powerful plant. It is not simply our occupation, but rather an essential part of our identity.'),
