(2863, 212, 'about_about_images', '4'),
(2864, 212, '_about_about_images', 'field_67039e987d74e'),
(2865, 212, 'about_abt_sub_heading', 'About Us'),
(2866, 212, '_about_abt_sub_heading', 'field_67039eca7d750'),
(2867, 212, 'about_abt_main_heading', 'About Us'),
(2868, 212, '_about_abt_main_heading', 'field_67039edc7d751'),
(2869, 212, 'about_blurb', '2'),
(2870, 212, '_about_blurb', 'field_67039f067d752'),
(2871, 212, 'about_content_full_width1', '<p>Zonacated is co-founded by Gabriel G. and Andrew M., We are known for our exotic flower strains with a focus on small-batched exquisite cannabis products. Zonacated has established a reputation for pushing only that which is quality to new heights.</p>\r\n\r\n<p>We have progressed significantly from our humble beginnings in our backyard and now run a cutting-edge cultivation facility, having a united purpose of producing cannabis that is not only powerful but also free of contaminants.</p>\r\n\r\n<p>Our commitment to excellence has not gone unnoticed. We are proud to have won the Errl Cup 2022 1st Place Indica Open Class Flower, a testament to the dedication and skill of our team. We take great pride in our craft and are constantly striving to push the boundaries of what\'s possible in the world of cannabis cultivation.</p>\r\n\r\n<p>We believe in the power of cannabis to heal, inspire, and connect people. That\'s why we go above and beyond to provide our customers with the highest quality, hand-crafted cannabis flower on the market. At Zonacated, we take pride in our craft. We carefully select and cultivate our cannabis flowers, ensuring that every batch is of the highest quality.</p>'),
(2872, 212, '_about_content_full_width1', 'field_67039fc17d755'),
(2873, 212, 'about_content_full_width2', '<p>Our flowers are hand-trimmed and cured to perfection, resulting in a product that is not only potent but also has a superior taste and aroma. Our team of expert growers carefully cultivates each strain with passion and expertise, ensuring that every bud is potent, flavorful, and truly unforgettable.</p>\r\n\r\n<p>Throughout our experience, we have remained dedicated to refining our cultivation techniques and altering the public\'s perception of cannabis. Despite the challenges posed by government regulations, we have continued to thrive and grow. Like roots through the soil, we remain firmly grounded in our commitment to providing our customers with the best cannabis flower available. Whether you\'re a long-time cannabis enthusiast or new to the world of craft cannabis, Zonacated has something to offer.</p>'),
(2874, 212, '_about_content_full_width2', 'field_67039fe47d756'),
(2875, 212, 'about_content_full_width3', '<p>Located in Tucson, Arizona, Zonacated is proud to be part of the vibrant and diverse cannabis community in the state. We are committed to using our platform to advocate for sensible cannabis policies and to support the growth of small businesses in the industry.</p>\r\n\r\n<p>We invite you to explore our product selection and experience the quality and care that goes into every Zonacated product. Thank you for choosing us as your premium craft cannabis flower brand. We are honored to be a part of your journey and look forward to serving you for years to come.</p>'),
(2876, 212, '_about_content_full_width3', 'field_67039ff17d757'),
