(3171, 280, 'content_full_width3', '<p>Located in Tucson, Arizona, Zonacated is proud to be part of the vibrant and diverse cannabis community in the state. We are committed to using our platform to advocate for sensible cannabis policies and to support the growth of small businesses in the industry.</p>\r\n\r\n<p>We invite you to explore our product selection and experience the quality and care that goes into every Zonacated product. Thank you for choosing us as your premium craft cannabis flower brand. We are honored to be a part of your journey and look forward to serving you for years to come.</p>'),
(3172, 280, '_content_full_width3', 'field_6703aced68194'),
(3173, 280, 'stains_heading', 'Our exclusive Zona strainssdsd'),
