(3745, 327, '_flower_content2', 'field_6715fe5a2793f'),
(3746, 290, 'flower_content3', '<p>Zonacated has arrived and taken our innovation to new galaxies; vapourizers, solventless premium products. You literally dont have to follow Elon to Mars or Washington DC. to find this weed, all you need is a renewed taste bud to appreciate Zonacated\'s way. </p>\r\n\r\n<p>Zonacated has arrived and taken our innovation to new galaxies; vapourizers, solventless premium products. You literally dont have to follow Elon to Mars or Washington DC. to find this weed, all you need is a renewed taste bud to appreciate Zonacated\'s way. </p>\r\n\r\n<p>Located in Tucson, Arizona, Zonacated is proud to be part of the vibrant and diverse cannabis community in the state. We are committed to using our platform to advocate for sensible cannabis policies and to support the growth of small businesses in the industry. </p>\r\n\r\n<p>We invite you to explore our product selection and experience the quality and care that goes into every Zonacated product. Thank you for choosing us as your premium craft cannabis flower brand. We are honored to be a part of your journey and look forward to serving you for years to come. </p>'),
