(7049, 498, '_about_about_images_3_image', 'field_67039eaa7d74f'),
(7050, 498, 'about_blurb_0_text', 'Welcome to Zonacated! your premium source for craft cannabis flower. We have arrived to deliver an unforgettable experience that will blow your mind. Our menu is constantly evolving with an array of cult-followed fire flavors that you won\'t want to miss. Keep checking back to see what\'s coming up next!'),
(7051, 498, '_about_blurb_0_text', 'field_67039f107d753'),
(7052, 498, 'about_blurb_1_text', 'We are a legacy brand that has been in the business since 2015 and have been thriving despite the challenges faced by small businesses in the industry. Our slogan, \"Roots of Legacy,\" speaks to our deep commitment to cultivating the finest cannabis flower, while honoring the rich history and culture of this powerful plant. It is not simply our occupation, but rather an essential part of our identity.'),
