(218, 1, '2024-10-07 05:41:11', '2024-10-07 05:41:11', 'Pineapple Burst is a rare and uplifting sativa-dominant hybrid with high potency and a delicious fruity tang. It smells like sweet and sour pineapple underscored with a funky gassy quality. The flavor is sweet and tropical with an earthy, minty exhale. Pineapple Burst catapults you into a strong, lasting high with an energizing euphoria and lifted, buzzing energy', 'Pineapple Burst', '', 'publish', 'closed', 'closed', '', 'pineapple-burst', '', '', '2024-12-17 11:28:18', '2024-12-17 11:28:18', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=218', 5, 'products_strains', '', 0),
