(221, 1, '2024-10-07 05:42:43', '2024-10-07 05:42:43', 'Super Buff Cherries has the smell of citrusy, grapefruit with an end of gas. You\'ll feel the cerebral effects hit you first, filling your mind with a lifted sense of focus and creativity that is perfect for helping you jump on any tasks or take on any social situation. A sense of physical relaxation comes next, slipping into your limbs and helping you to stretch out and relax without any aches or pains.', 'Super Buff Cherries', '', 'publish', 'closed', 'closed', '', 'super-buff-cherries', '', '', '2024-12-17 12:10:13', '2024-12-17 12:10:13', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=221', 9, 'products_strains', '', 0),
(222, 1, '2024-10-07 05:44:48', '2024-10-07 05:44:48', 'Mimosa, also known as \"Purple Mimosa,\" is a hybrid marijuana strain made by crossing Clementine with Purple Punch. This strain produces happy, level-headed effects that will leave you feeling uplifted and motivated enough to take on any task. In large doses, Mimosa may make you feel sleepy and relaxed. This strain has a strong aroma and flavor that reminds you of its namesake, with notes of fruit and citrus flavors bursting through.', 'Mimosa', '', 'publish', 'closed', 'closed', '', 'mimosa', '', '', '2024-12-18 06:09:28', '2024-12-18 06:09:28', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=222', 3, 'products_strains', '', 0),
