(224, 1, '2024-10-07 05:45:22', '2024-10-07 05:45:22', 'Skunk Piss is a sativa-dominant cross between Super Skunk and Chemdawg that elevates the mood with a sweet and sour aroma. Its effects are long-lasting but clear-headed, making Skunk Piss a popular choice for use throughout the day. This sativa may be all you need to give your appetite an edge or to help you stay productive and focused.', 'Skunk Piss', '', 'publish', 'closed', 'closed', '', 'skunk-piss', '', '', '2024-12-17 11:34:46', '2024-12-17 11:34:46', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=224', 6, 'products_strains', '', 0),
