(226, 1, '2024-10-07 05:46:07', '2024-10-07 05:46:07', 'Octane Mintz, Fill your tank with Octane Mintz, a high-octane hybrid that combines the fuel-forward Sunset Octane with the sweet and creamy Wedding Cake. This strain offers a powerful and euphoric high that is perfect for experienced users. Expect a creative burst of energy, followed by a deep sense of relaxation and well-being. The aroma is a complex mix of fuel, sweet vanilla, and earthy undertones.', 'Octane Mintz', '', 'publish', 'closed', 'closed', '', 'octane-mintz', '', '', '2024-12-17 11:01:35', '2024-12-17 11:01:35', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=226', 4, 'products_strains', '', 0),
