(228, 1, '2024-10-07 05:46:56', '2024-10-07 05:46:56', 'Meat Breath is an indica-dominant marijuana strain that crosses Meatloaf and the fabled Mendo Breath. It has deep purples, bright greens, orange hairs, and thick trichome coverage, making this flower striking in both color and contrast. This THC-dominant strain was designed to kick hard. For the experienced consumer, its effects will uplift your mood and bring a deep relaxation to your body, providing a gentle nudge to sleep. People report it useful for chronic issues surrounding pain and sleep. ', 'Meat Breath', '', 'publish', 'closed', 'closed', '', 'meat-breath', '', '', '2024-12-18 06:17:50', '2024-12-18 06:17:50', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=228', 2, 'products_strains', '', 0),
