(230, 1, '2024-10-07 05:48:53', '2024-10-07 05:48:53', 'Buttermilk Biscuits is an indica dominant hybrid strain created through crossing the delicious Pancakes x Biscotti strains. Buttermilk Biscuits packs a delicious doughy flavor like freshly baked nutty biscuits, accented by a sweet vanilla. The Buttermilk Biscuits high has a definite creeping build, you\'ll find yourself slowly falling into a sense of lifted happiness and physical relaxation. Buttermilk Biscuits is often chosen to treat conditions such as insomnia, depression or mood swings, chronic stress or anxiety and chronic pain.', 'Buttermilk Biscuits', '', 'publish', 'closed', 'closed', '', 'buttermilk-biscuits', '', '', '2024-12-17 10:12:13', '2024-12-17 10:12:13', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=230', 0, 'products_strains', '', 0),
