(232, 1, '2024-10-07 05:50:05', '2024-10-07 05:50:05', 'Slurricane is an indica marijuana strain made by crossing Do-Si-Dos with Purple Punch. Slurricane produces relaxing effects that come on slowly. This strain has a sweet flavor profile, with subtle grape and sugary berries. Slurricane is the ideal strain for relaxing after a long day and will likely leave you locked to your sofa. Medical marijuana patients choose this strain to help relieve symptoms associated with insomnia.', 'Slurricane', '', 'publish', 'closed', 'closed', '', 'slurricane', '', '', '2024-12-17 12:01:24', '2024-12-17 12:01:24', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=232', 7, 'products_strains', '', 0),
