(234, 1, '2024-10-07 05:50:52', '2024-10-07 05:50:52', 'Sundae Driver, also known as \"Sunday Driver,\" is a hybrid marijuana strain made by crossing FPOG with Grape Pie. Sundae Driver’s effects include feeling relaxed, giggly, and happy. Sundae Driver has a sweet, mellow and creamy flavor. Growers say this strain comes in light green and purple buds that are drenched in trichomes.', 'Sundae Driver', '', 'publish', 'closed', 'closed', '', 'sundae-driver', '', '', '2024-12-17 12:56:41', '2024-12-17 12:56:41', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=234', 10, 'products_strains', '', 0),
