(236, 1, '2024-10-07 05:52:30', '2024-10-07 05:52:30', 'Strawberry Cheesecake is an indica-dominant marijuana strain made by generations of backcrossing Purple Panty Dropper and a Forum cut of GSC. Strawberry Cheesecake delivers effects that melt away physical pain while allowing the mind to soar with creative energy. This strain tastes like its namesake suggests —sweet and creamy with undertones of berry. The combination makes this strain ideal for managing symptoms of depression and fatigue.', 'Strawberry Cheesecake', '', 'publish', 'closed', 'closed', '', 'strawberry-cheesecake', '', '', '2024-12-18 06:21:52', '2024-12-18 06:21:52', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=236', 8, 'products_strains', '', 0),
