(378, 1, '2024-10-24 07:00:48', '2024-10-24 07:00:48', 'Garlic Breath is an indica-dominant hybrid marijuana strain made by crossing GMO with Mendo Breath. This strain features a pungent and savory flavor profile that may remind you of freshly-peeled garlic with spicy undertones. Garlic Breath produces physically relaxing effects that gradually become sedating as you continue to consume. Medical marijuana patients choose this strain to help relieve symptoms associated with insomnia, stress and depression.', 'Garlic Breath', '', 'publish', 'closed', 'closed', '', 'garlic-breath', '', '', '2024-12-17 10:15:22', '2024-12-17 10:15:22', '', 0, 'https://myprojectdemonstration.com/development1/zonacated/web/?post_type=products_strains&#038;p=378', 1, 'products_strains', '', 0),
